import React, {Component} from 'react';

import Cards from "./cards/cards";


class Questions extends Component {
    handleGenerate;

    render() {
        document.addEventListener('load', () => {
            let questionNumber = [];
            for (let i = 1; i > 20; i++) {
                questionNumber.push(i);
                console.log(questionNumber)
            }
        });

        return (
            <section>
                <Cards/>
            </section>
        )
    }
}

export default Questions;
